import React from "react";

const Rewards = () => {
  return (
    <section id="rewards">
      <h2>Certificates & Rewards</h2>
      <ul>
        <li>Certification in Introduction to Databases</li>
        <li>Certification in Operating Systems </li>
      </ul>
    </section>
  );
};

export default Rewards;
